    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 + 36 + - 32 * - + 92 / - ( col1 ) > ( + 13 ) * col1 - col2;
  - name: tab1

outputs:
  - name: q162.out
    data: |
      51	14	96
      85	5	59
      91	47	68
